Defendant Maurice W Williams in court with attorney Samuel W. Benedict.  Melissa Zilavy appeared for the State of Wisconsin.    The Defendant was sentenced to the following:

IMPOSED AND STAYED SENTENCE OF:  

Count #1:

9 MONTHS JAIL;

TERM OF PROBATION:  2 YEARS; (may be transferred to Milwaukee County).

CONDITIONS OF PROBATION:  
*Follow through with any treatment and/or counseling recommended by Agent;
*Maintain full time employment and/or combination of schooling 
*DNA sample to be provided if not yet previously done.
*Perform 100 Hours Community Service.
*Any other term deemed appropriate by agent. 

RESTITUTION:   TO BE DETERMINED;

COURT COSTS:  $253.00 (apply cash bail );

DNA SURCHARGE:  $200.00 (apply cash bail);

CONDITION TIME: 5 MONTHS non-working hours, apply 76 days credit.  The Defendant is to report by 5:00 p.m. on 3/9/16. (may be served in Milwaukee County but the Court does not grant electronic monitoring).

Count #2:

9 MONTHS JAIL; (consecutive to Count #1).

TERM OF PROBATION:  2 YEARS; 

Conditions of probation: See count #1

RESTITUTION:   TO BE DETERMINED;

COURT COSTS:  $243.00 (apply cash bail and balance to be paid as a condition of probation);

DNA SURCHARGE:  $200.00 (to be paid as a condition of probation);


The State to file a restitution request by 4/8/16 and Attorney Benedict to file a response by 4/25/16.
